import React, { Fragment } from 'react';

import CardsListEl from '../ListElement';
import SingleCard from '../SingleCard';

const CardsList = ({ cards }) => {
   const cardsList = cards.map((card, i) => {
      return <SingleCard 
               key={card[i].id} 
               number={card[i].number}
               expiresMonth={card[i].expiresMonth}
               expiresYear={card[i].expiresYear}
               />
   })
   return (
      <Fragment>
         <h1>Cards</h1>
         <p>You have {cardsList.length} active cards</p>
         <div className="row">
            {cardsList}
         </div>
      </Fragment>
   );
}

export default CardsList;
